import React, { Component } from 'react';
import './Main2content.css';


class Main2content extends Component {
  render() {
    return (
      <div className="main2content">
        <div id = "main2content">
          <h2 className="main2content__title">We will unlock people's potential to imagine and </h2>
          <h2 className="main2content__title">create new solutions to our greatest challenges</h2>

          <p className="main2content__text">The UAE has a vision for the future based on radical creativity
          curiosity and generosity and invite the world's most curious minds and creative institutions to 
          co-create this future with us</p>
        </div>
      </div>
    );
  }
}

export default Main2content;
